import React from 'react';

const Cart = (props) => {
    const cart = props.cart;

    const totalPrice =  cart.reduce((total, product) => total + product.price, 0);

    return (
        <div>
            <h4>Items Add to Cart: {props.cart.length}</h4>
            <h3>{totalPrice}</h3>
        </div>
    );
};

export default Cart;
